import React from 'react';

import './index.css';
import 'bootstrap/dist/css/bootstrap.css';

function App() {
  return (
    <div>
      <h1>Registro</h1>
      <div className="form-group">
        <label htmlFor="empresaNombre">Nombre de la empresa</label>
        <input type="text" className="form-control" id="empresaNombre" aria-describedby="emailHelp" placeholder="Nombre de la empresa" />
      </div>
      <div className="form-group">
        <label htmlFor="empresaCorreo">Direccion de correo electronico</label>
        <input type="text" className="form-control" id="empresaEmail" aria-describedby="emailHelp" placeholder="correo de la empresa" />
      </div>
      <div className="form-group">
        <label htmlFor="empresaCedula">Cedula juridica</label>
        <input type="text" className="form-control" id="empresaCedulaJuridica" aria-describedby="emailHelp" placeholder="cedula juridica" />
      </div>
    </div>
  );
}

export default App;
